import React, { Component } from 'react';
import _ from 'lodash';
class TableBody extends Component {
 
//table data 넣어주는 메소드
   renderCell = (data) => {
    return _.get(data);
   }; 
    render() {
        const {data} = this.props;
        data.map((d) => {
            const { id, username } = d;
            return (
                <li key={id} class>
                    {username}
                </li>
            );
        });
        return ( 
            <tbody>
 
 

                {data.map(data => 
                <tr key={data.id}>
                    <td>{data.title}</td>)
                </tr> )}
                
            </tbody>
         );
    }
}
 
export default TableBody;
